import { useEffect, useState } from 'react';

export default function useFetch() {
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState<Error | null>();
  const [countries, setCountries] = useState<Country[] | null>();
  const ApiUrl =
    'https://restcountries.com/v3.1/all?fields=name,cca3,capital,region,languages,currencies,borders,population,flags,tld,subregion';
  const storedCountries = localStorage.getItem('countries');

  useEffect(() => {
    async function fetchCountries() {
      setError(null);
      setIsLoading(true);
      if (storedCountries) {
        setIsLoading(false);
        setCountries(JSON.parse(storedCountries) as Country[]);
      } else {
        try {
          const response = await fetch(ApiUrl);
          const data = (await response.json()) as Country[];
          setIsLoading(false);
          setCountries(data);
          localStorage.setItem('countries', JSON.stringify(data));
        } catch (err) {
          setIsLoading(false);
          setError(err as Error);
        }
      }
    }
    fetchCountries();
  }, [storedCountries]);

  return { isLoading, error, countries };
}


